import React from 'react';
class Skills extends React.Component{
	render(){
		return(
			<div id="hero" className="section section-hero">
				<div className="section-hero--copy" data-aos="fade-down">
				<h1>Skills</h1></div>
				<div className="section-hero--image" data-aos="fade-up">
				<h2>UI development</h2>
					<ul>

<li>CSS</li>
<li>SCSS</li>
<li>Javascript</li>
<li>jQuery</li>
<li>PHP</li>
<li>Wordpress custom theme and plugin development</li>
<li>React</li>
<li>NPM</li>
<li>Git</li>
<li>Bitbucket</li>
					</ul>
				</div>
			</div>
			);
	}
}
export default Skills;
